  items: Todo[];
  hanldeRemove: () => void;
}) {
  return (
    <ul className={styles.todos}>
      {items.map((item) => (
        <TodoItem key={item.id} text={item.text} onRemoveTodo={onRemove} />
      ))}
    </ul>
  );
}
